import React from "react";
import {HealthCheckEntry} from "../types";
import {Icon} from "semantic-ui-react";

const HealthCheckDisplay: React.FC<({entry: HealthCheckEntry, showIconType: any})>=({entry, showIconType})=>{
    // console.log(entry)
    return(
        <section>
            <h3>{entry.date}, <Icon className={showIconType(entry.type)}/></h3>
            <p>{entry.description}</p>
            <p>{entry.healthCheckRating}</p>
        </section>
    )
}

export default HealthCheckDisplay;
